import React, { Component } from "react";
import axios from "axios";

class Test extends Component {
  state = {
    url_photo: "",
    url_video: "",
    project_info: "",
    project_title: "",
  };

  getinfo = () => {
    axios.get("http://localhost:5000/info/").then((res) => console.log(res));
  };

  render() {
    return <React.Fragment></React.Fragment>;
  }
}

export default Test;
